    // Loop through the background images so we can preload them
    function ot_bg_preloader() {
        var images = [];
        for (var i = 0; i < arguments.length; i++) {
            images[i] = new Image();
            images[i].src = ot_bg_preloader.arguments[i];
        }
    }

